By default, fetch makes a GET request, but you can specify different HTTP methods like POST, PUT, and DELETE using the RequestInit object. Sending a POST Request with fetch A POST request is used to send data to a server. This typically requires a request body in JSON format and specifying the appropriate headers. async function createPost() { try { const response = await fetch("https://jsonplaceholder.typicode.com/posts", { method: "POST", headers: { "Content-Type": "application/json", }, body: JSON.stringify({ title: "New Post", body: "This is a new post", userId: 1, }), }); if (!response.ok) { throw new Error(`HTTP error! Status: ${response.status}`); } const data = await response.json(); console.log("Created post:", data); } catch (error) { console.error("Fetch error:", error); }
} createPost(); :bulb: Always set the Content-Type header to "application/json" when sending JSON data in a POST request. Sending a PUT Request A PUT request is used to update an existing resource. async function updatePost(postId) { try { const response = await fetch(`https://jsonplaceholder.typicode.com/posts/${postId}`, { method: "PUT", headers: { "Content-Type": "application/json", }, body: JSON.stringify({ id: postId, title: "Updated Post", body: "This post has been updated", userId: 1, }), }); if (!response.ok) { throw new Error(`HTTP error! Status: ${response.status}`); } const data = await response.json(); console.log("Updated post:", data); } catch (error) { console.error("Fetch error:", error); }
} updatePost(1); :warning: PUT typically replaces the entire resource, so all fields must be included in the request body. Sending a DELETE Request A DELETE request removes a resource from the server. async function deletePost(postId) { try { const response = await fetch(`https://jsonplaceholder.typicode.com/posts/${postId}`, { method: "DELETE", }); if (!response.ok) { throw new Error(`HTTP error! Status: ${response.status}`); } console.log(`Post ${postId} deleted successfully`); } catch (error) { console.error("Fetch error:", error); }
} deletePost(1); :bulb: Unlike POST or PUT, a DELETE request typically does not require a request body.

